import { BrowserRouter as Link } from "react-router-dom";

const Header = () => {
  return (
    <header>
      <h1 className="logo">Dover</h1>
      <div className="header-genre">
        <ul>
          <li>
            <Link to={`/items/electric_guitar/`}>electric guitar</Link>
          </li>
          <li>
            <a href="#">アコースティックギター</a>
          </li>
          <li>
            <a href="#">ベース</a>
          </li>
          <li>
            <a href="#">エフェクター</a>
          </li>
        </ul>
      </div>
    </header>
  );
};

export default Header;
